import React ,{ Component } from "react";
import Link from "next/link";
import fetch from 'isomorphic-fetch';
import Layout from "../Components/Layout";


class Home extends Component{
    
    componentDidMount() {
        Home.getInitialProps();
      }
    render()
    {
        return(
        <Layout>
            <div>
                <h1>Hello Steritrack</h1>
                
            </div>
            </Layout>
        );
    }
}

export default Home;
